import React from "react";
import { Helmet } from "react-helmet";
import { Link } from "react-router-dom";
import "./home.css";

const Home = (props) => {
  return (
    <div className="home-container">
      <Helmet>
        <title>exported project</title>
      </Helmet>
      <div className="home-home">
        {/* Navbar */}
        <div className="home-navbar">
          {/* Home */}
          <Link to="/" className="home-nav-link">
            <span className="home-text75">
              <span>Home</span>
            </span>
          </Link>
          {/* Event */}
          <Link to="/event" className="home-nav-link">
            <span className="home-text77">
              <span>Event</span>
            </span>
          </Link>
          {/* Pesanan */}
          <Link to="/pesanan" className="home-nav-link">
            <span className="home-text79">
              <span>Pesanan</span>
            </span>
          </Link>
          {/* Catering */}
          <Link to="/catering" className="home-nav-link">
            <span className="home-text81">
              <span>Catering</span>
            </span>
          </Link>
        </div>
        {/* Konten lainnya */}
        <div className="home-healthiconspenis"></div>
        <div className="home-banner">{/* Insert banner JSX here */}</div>
        <div className="home-rekomendasi-resto">
          {/* Insert recommended restaurant JSX here */}
        </div>
        <div className="home-rekomendas-menu">
          {/* Insert recommended menu JSX here */}
        </div>
        <div className="home-catering">{/* Insert catering JSX here */}</div>
        <div className="home-navbar">{/* Insert second navbar JSX here */}</div>
        <div className="home-group150">{/* Insert group150 JSX here */}</div>
        <div className="home-ann">{/* Insert announcement JSX here */}</div>
        <div className="home-footer">{/* Insert footer JSX here */}</div>
      </div>
    </div>
  );
};

export default Home;
